import { useState } from "react";
import { useInventoryStore } from "../store/inventoryStore";

export default function Movements() {
  const { products, addMovement, updateProduct } = useInventoryStore();
  const [form, setForm] = useState({ productId: "", type: "in", qty: 1, date: new Date().toISOString().slice(0,10), note: "" });

  const onSubmit = (e) => {
    e.preventDefault();
    const product = products.find(p => p.id === form.productId);
    if (!product) return;
    const qty = Number(form.qty);
    const newStock = form.type === "in" ? (product.stock || 0) + qty : (product.stock || 0) - qty;
    updateProduct(product.id, { stock: newStock });
    addMovement({ ...form, qty, id: crypto.randomUUID() });
    setForm({ productId: "", type: "in", qty: 1, date: new Date().toISOString().slice(0,10), note: "" });
  };

  return (
    <div className="grid gap-4 md:grid-cols-2">
      <div className="card">
        <h2 className="font-semibold mb-3">Registrar movimento</h2>
        <form onSubmit={onSubmit} className="space-y-3">
          <div>
            <label className="label">Produto</label>
            <select className="select" value={form.productId} onChange={e=>setForm({...form, productId:e.target.value})} required>
              <option value="">Selecione</option>
              {products.map(p => <option key={p.id} value={p.id}>{p.name} — {p.sku}</option>)}
            </select>
          </div>
          <div className="grid grid-cols-3 gap-2">
            <div>
              <label className="label">Tipo</label>
              <select className="select" value={form.type} onChange={e=>setForm({...form, type:e.target.value})}>
                <option value="in">Entrada</option>
                <option value="out">Saída</option>
              </select>
            </div>
            <div>
              <label className="label">Quantidade</label>
              <input type="number" className="input" value={form.qty} onChange={e=>setForm({...form, qty:e.target.value})} min="1" />
            </div>
            <div>
              <label className="label">Data</label>
              <input type="date" className="input" value={form.date} onChange={e=>setForm({...form, date:e.target.value})} />
            </div>
          </div>
          <div>
            <label className="label">Observação</label>
            <input className="input" value={form.note} onChange={e=>setForm({...form, note:e.target.value})} />
          </div>
          <button className="btn btn-primary" type="submit">Salvar movimento</button>
        </form>
      </div>
      <div className="card">
        <h2 className="font-semibold mb-3">Dicas para precisão</h2>
        <ul className="list-disc pl-5 text-sm text-slate-700 space-y-1">
          <li>Registre quebras e perdas como "saída" com observação.</li>
          <li>Conferir código/SKU antes de lançar.</li>
          <li>Auditar diferenças toda sexta-feira.</li>
        </ul>
      </div>
    </div>
  );
}
